import React from "react";
import { View, StyleSheet, TouchableOpacity, Text } from "react-native";
import BoxInfo from "./profile/boxInfo";
import UserList from "./profile/userList";

const BoxProfile = () => {
  return (
    <React.Fragment>
      <BoxInfo />
      <UserList listName={"Friend"}/>
      <UserList listName={"Following"}/>
    </React.Fragment>
  );
};

const styles = StyleSheet.create({
  infoContainer: {
    backgroundColor: "#FFF",
    borderRadius: 5,
    padding: 10,
    marginVertical: 10,
  },
  infoImgProfile: {
    width: 60,
    height: 60,
    backgroundColor: "#CCC",
    borderRadius: 100,
  },
});

export default BoxProfile;
